import React from "react";
import styled from "styled-components";
import '../App.css';

const Title = styled.div`

    color:#FFFFFF;
    font-family: "Montserrat";
    font-size: 40px;
    font-weight: 600;
    line-height: 19px;
    text-align: left;
    
    height:33px;

`;

const Subtitle = styled.div`

    color:#FFFFFF;
    font-family: Montserrat;
    font-size: 20px;
    font-weight: 300;
    line-height: 19px;
    text-align: left;
 
`;

const Foot = styled.div`

    display:flex;
    bottom:0px;
    position:relative;
    background-color:#0F52BA;
    font-family: Montserrat;
    font-size: 20px;
    font-weight: 300;
    line-height: 19px;
    text-align: left;
    width:100%; 
    height:34px; 
    align-items:center; 
    justify-content:space-between; 
    padding:20px 40px; 
    box-sizing:border-box
 
`;


const Footer = (props:any) => {



    return(
        <Foot>
            <div style={{display:'flex', justifyContent:'space-between', alignItems:'baseline'}}>
                <Title style={{}}>
                    MKS&nbsp;
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
            </div>      
            <div style={{display:'flex', justifyContent:'space-between', alignItems:'baseline'}}>
                <Title style={{}}>
                    MKS&nbsp;
                </Title>
                <Subtitle>
                    Sistemas
                </Subtitle>
            </div>    
        </Foot>
    )

}

export default Footer;
